import React from 'react';
import './registerpage.css';

class registerpage extends React.Component {

  constructor() {
    super()
    this.state={
      username: '',
      password: '',
      password2: ''
    }
  }

  updateUsername = (_evnt) => {
    this.setState({username: _evnt.target.value});
  }

  updatePassword = (_evnt) => {
    this.setState({password: _evnt.target.value});
  }

  updatePassword2 = (_evnt) => {
    this.setState({password2: _evnt.target.value});
  }


  render() {
    return (
      <div className="App">
        <div className='signinform'>
          <input className='glassmorph inputbox' type='text' onChange={this.updateUsername} placeholder='Username'/><br/>
          <input className='glassmorph inputbox' type='text' onChange={this.updatePassword} placeholder='Password'/><br/>
          <input className='glassmorph inputbox' type='text' onChange={this.updatePassword2} placeholder='Confirm Password'/><br/>
          <button type='button' className='glassmorph signinBtn'>Register</button><br/>
        </div>
      </div>
    );
  }
}

export default registerpage;
